import './App.css';

function App() {
  return (
    <div className='conainer'>
      <div className='calculator'>
        <form action=''>
          <div>
            <input type='text'></input>
          </div>
          <div>
            <input type='button' value="AC"/>
            <input type='button' value="DE"/>
            <input type='button' value="."/>
            <input type='button' value="/"/>
          </div>
        </form>
      </div>
    </div>
  );
}

export default App;
